import { Injectable } from '@angular/core';
import { HttpClient, HttpHeaders } from '@angular/common/http';
import { PicturePageComponent } from './picture-page.component';
import { Observable } from 'rxjs';


@Injectable({
  providedIn: 'root'
})
export class PicServiceService {
  private usersUrl: string;

  constructor(private http: HttpClient) {
    this.usersUrl = 'http://localhost:8080/api/v1/pictures';
  }

  public findAll(): Observable<PicturePageComponent[]> {
    return this.http.get<PicturePageComponent[]>(this.usersUrl);
  }

  public save(picture: PicturePageComponent) {
    return this.http.post<PicturePageComponent>(this.usersUrl, picture);
  }
}
